import React from 'react';
import logo from './logo.svg';
import './css/App.css';
import './css/main.css';
import './css/contents.css';
import './css/cssset.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
            <table summary="メール送信">
              <tr>
                <th>お名前</th>
                <td>
                input name="company" type="text" className="short" onChange={this.handleChangeText} value={this.state.name} />
                </td>
              </tr>
            </table>
            <p className="ali_center">
              <input type="submit" class="form_btn" value="確認画面へ ＞" />
            </p>
      </header>
    </div>
  );
}

export default App;
